import  React, { Component } from  'react';
import { BrowserRouter } from  'react-router-dom'
import { Route, Link } from  'react-router-dom'
import  ArtistList  from  './ArtistList'
import  ArtistCreateUpdate  from  './ArtistCreateUpdate'
import  './App.css';

const  BaseLayout  = () => (
  <div  className="container-fluid">
      <nav  className="navbar navbar-expand-lg navbar-light bg-light">
          <a  className="navbar-brand"  href="#">Django React Demo</a>
          <button  className="navbar-toggler"  type="button"  data-toggle="collapse"  data-target="#navbarNavAltMarkup"  aria-controls="navbarNavAltMarkup"  aria-expanded="false"  aria-label="Toggle navigation">
          <span  className="navbar-toggler-icon"></span>
      </button>
      <div  className="collapse navbar-collapse"  id="navbarNavAltMarkup">
          <div  className="navbar-nav">
              <a  className="nav-item nav-link"  href="/">ARTISTS</a>
              <a  className="nav-item nav-link"  href="/artist">CREATE ARTIST</a>
          </div>
      </div>
      </nav>
      <div  className="content">
          <Route  path="/"  exact  component={ArtistList}  />
          <Route  path="/artist/:pk"  component={ArtistCreateUpdate}  />
          <Route  path="/artist/"  exact  component={ArtistCreateUpdate}  />
      </div>
  </div>
  )

  class  App  extends  Component {

    render() {
        return (
        <BrowserRouter>
            <BaseLayout/>
        </BrowserRouter>
        );
    }
    }
    export  default  App;
